import { FaDiscord } from 'react-icons/fa';
import { FaTwitter } from 'react-icons/fa';
import { MainButton } from '../utils/contexts/styles';
import { HomePageStile } from '../utils/contexts/styles';

export const HomePage = () => (
    
   <HomePageStile>
        <div></div>
        <div>
            <MainButton>
                <FaDiscord size={50} />
                <p style={{marginLeft: '20px'}}>Login with Discord</p>
                </MainButton>
                <MainButton>
                <FaTwitter size={50} />

                <p style={{marginLeft: '20px'}}>Login with Twitter </p>
                </MainButton>

        </div>
        <div
            style={{
                display: 'flex',
                width: '400px',
                justifyContent: 'space-between'
            }}>
            <span>Discord </span>
            <span>Twitter </span>
            <span>t </span>
        </div>

</HomePageStile>
);
